import React, { Component } from "react";

export default class Tour extends Component {
  render() {
    return (
      <article className="tour">

          {/* Tour Image container for image grid */}
        <div className="img-container">
          <img
            width="400px"
            src="https://images.pexels.com/photos/1984121/pexels-photo-1984121.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
            alt=""
          />


          {/* close button on hover on Image */}

          <span className = "close-btn">
            <i className="fas fa-window-close"/>
          </span>
        </div>

        {/* Tour Image Information */}

        <div className = "tour-info">
        <h3>City</h3>
        <h4>City Name</h4>
        <h5>info 
            <span>i.fas.fa.create</span>
        </h5>
        </div>
      </article>
    );
  }
}
